import Header from './Header';
import TestHeader from '../components/TestHeader';

const layoutStyle = {
  margin: 0 - 9,
  background: 'black',
  height: '100vh',
};

const Layout = props => (
  <div style={layoutStyle}>
    <TestHeader />
    {props.children}
  </div>
);

export default Layout;
